import React, { Component } from "react";
import Func from "../components/Func";
import ListCours from "../components/ListCours";
import Navbar from "../components/navbar";

export default class DeuxiemeAcCours extends Component {
  render() {
    return (
      <div>
        <Navbar />
        <main class="container mainback">
          <div class="row">
            {/*------------------colonne de gauche--------*/}

            <div class="col-xs-12 col-sm-12 col-md-12 col-lg-9 col-xl-9 col-xxl-9">
              <Func pth="/PremierAcCours" />
            </div>

            {/*--------------colonne de droite ------------*/}

            <div class="d-none d-sm-none d-md-none d-lg-block d-xl-block d-xxl-block col-lg-3 col-xl-3 col-xxl-3 mt-5">
              <Func pth="/PremierAcCours" />
            </div>

            <div><ListCours pth="/PremierAcCours" /></div>
          </div>
        </main>
      </div>
    );
  }
}
